import React, { Component } from "react";

class LatestArticle extends Component {
  state = {};
  render() {
    return (
      <div
        id="latestArticle"
        style={{
          display: "grid",
          gridTemplateColumns: "20% 1fr 1fr",
          gridAutoRows: minmax(100, "auto"),
        }}
      >
        <div style={{ backgroundColor: "red" }}>Words1</div>
        <div style={{ backgroundColor: "purple" }}>Words2</div>
        <div style={{ backgroundColor: "black" }}>Words2</div>
      </div>
    );
  }
}

export default LatestArticle;
